This mod adds new equip/unequip animations to the XPMSSE Style Fitting Animations.

Animations for Axe/Mace/Dagger + Shield and dual wield combinations of Sword/Dagger + Axe/Mace or Axe/Mace + Sword/Dagger;



It replaces some animations from XPMSSE as well as adds the other animations with Open Animation Replacer.

